import React from "react";
import { NavLink } from "react-router-dom";
import "./NavBar.scss";

const NavBar = () => {
  const linkStyles = {
    color: "white",
    background: "gray",
    padding: "20px",
    margin: "10px",
    width: "100px",
    textDecoration: "none",
  };
  return (
    <div>
      <NavLink to="/homeview" className="meme-book">
        Meme <br />
        <span
          style={{
            color: "black",
            fontSize: "50px",
            textShadow: "0 0 2px white",
          }}
        >
          Book
        </span>
      </NavLink>

      <div className="nav-bar">
        <NavLink
          to="/homeview/upload"
          className="meme"
          activeStyle={{ background: "", color: "black" }}
        >
          Upload
        </NavLink>
        <NavLink to="/homeview/create" className="meme">
          Create
        </NavLink>
        <a href="/" className="meme">
          Logout
        </a>
      </div>
    </div>
  );
};

export default NavBar;
